import { v4 as uuidv4 } from 'uuid';

// Static IDs for initial state
const initialProgramId = uuidv4();
const initialWorkoutId = uuidv4();
const initialExerciseId = uuidv4();

export const initialState = {
  programs: {
    [initialProgramId]: {
      id: initialProgramId,
      name: 'Program 1',
      program_duration: 0,
      duration_unit: '',
      days_per_week: 0,
      main_goal: ''
    }
  },
  workouts: {
    [initialWorkoutId]: {
      id: initialWorkoutId,
      name: 'Workout 1',
      exercises: [], // This will now reference IDs rather than containing objects directly
      active: false,
      programId: initialProgramId
    }
  },
  exercises: {
    [initialExerciseId]: {
      id: initialExerciseId,
      name: 'Exercise 1',
      workoutId: initialWorkoutId
    }
  },
  sets: {
    'set-uuid-1': {
      id: uuidv4(),
      count: 10,
      weight: 50,
      exerciseId: initialExerciseId
    }
  }
};
